var blue = '#0000FF';
var BLUE = '#0000FF';
var yellow = '#FFFF00';
var YELLOW = '#FFFF00';
var cyan = '#00FFFF';
var CYAN = '#00FFFF';
var orange = '#FFA500';
var ORANGE = '#FFA500';
var white = '#FFFFFF';
var WHITE = '#FFFFFF';
var black = '#000000';
