    ERROR_NO_BEEPERS = -3
    ERROR_CRASH_INTO_WALL = -2
    ERROR = -1
    EAST = 0
    NORTH = 1
    WEST = 2
    SOUTH = 3
    NUM_DIRS = 4

    DIRECTIONS = {}
    DIRECTIONS[0] = "EAST"
