    DIRS["NORTH"] = 1
    DIRS["WEST"] = 2
    DIRS["SOUTH"] = 3

    MOVE = 5
    PUT_BALL = 6
    TAKE_BALL = 7
    TURN_LEFT = 8
    TURN_RIGHT = 9
    TURN_AROUND = 10

    FRONT_IS_CLEAR = 11
    LEFT_IS_CLEAR = 12
    RIGHT_IS_CLEAR = 13

    BALLS_PRESENT = 14

    FACING_NORTH = 15
    FACING_SOUTH = 16
    FACING_EAST = 17
    FACING_WEST = 18

    FUNCTION = 19
